DROP TABLE IF EXISTS `ds_pay_code`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ds_pay_code` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `category` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '类别',
  `erwei` text NOT NULL COMMENT '图片链接',
  `money` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '打赏金额',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '上传时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态（1启用，2禁用）',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `file_md5` varchar(64) NOT NULL DEFAULT '',
  `nickname` varchar(50) DEFAULT NULL,
  `total_amount` int(11) NOT NULL DEFAULT '0' COMMENT '总金额',
  `amount` int(12) NOT NULL DEFAULT '0' COMMENT '今天收入',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
