--

DROP TABLE IF EXISTS `ds_pay_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ds_pay_order` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `uid` int(10) NOT NULL DEFAULT '0',
  `nickname` varchar(50) DEFAULT NULL,
  `ua` varchar(255) DEFAULT NULL COMMENT '客户端唯一标识',
  `des` varchar(255) DEFAULT NULL COMMENT '描述记录',
  `vid` int(10) NOT NULL DEFAULT '0' COMMENT '视频id',
  `pay_channel` varchar(255) DEFAULT '' COMMENT '支付渠道',
  `ip` varchar(64) NOT NULL DEFAULT '0' COMMENT 'ip',
  `price` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `tc_money` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '总代理提成',
  `createtime` int(10) NOT NULL DEFAULT '0' COMMENT '下单时间',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `paytime` int(11) DEFAULT NULL COMMENT '支付时间',
  `status` enum('1','2') NOT NULL DEFAULT '2' COMMENT '支付状态:1=已支付,2=未支付',
  `pid` int(11) unsigned NOT NULL DEFAULT '0',
  `pid_top` int(11) NOT NULL DEFAULT '0' COMMENT '总代理id',
  `is_kouliang` enum('2','1') NOT NULL DEFAULT '2' COMMENT '是否扣量:1=不扣量,2=扣量',
  `transact` varchar(64) NOT NULL COMMENT '订单号',
  `is_month` enum('1','2') DEFAULT '1' COMMENT '是否包月:1=否,2=是',
  `is_date` enum('1','2') DEFAULT '1' COMMENT '是否包日:1=否,2=是',
  `is_week` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `order` (`transact`) USING BTREE,
  KEY `uid` (`uid`) USING BTREE,
  KEY `uids` (`status`,`uid`) USING BTREE,
  KEY `uc` (`uid`,`status`,`createtime`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1131 DEFAULT CHARSET=utf8mb4 COMMENT='支付记录';
